let state = {
    postsDt: [
        {id: 1, post: 'Hi, how are u?', likes: 12},
        {id: 2, post: 'Hi, everybody!', likes: 36},
        {id: 3, post: 'OK. And u?', likes: 26}
        ],
    dialoguesDt: [
        {id: 1, name: 'Мария'},
        {id: 2, name: 'Антон'},
        {id: 3, name: 'Мартин'},
        {id: 4, name: 'Алексей'},
        {id: 5, name: 'Евгения'}
    ],
    messagesDt: [
        {id: 1, message: 'Hi!'},
        {id: 2, message: 'How r u?'},
        {id: 3, message: 'OK. And you?'}
    ]
}

export default state;
